local ffi = require 'ffi'

client.color_log = function() end
print = function() end;

local o_cast = ffi.cast
ffi.cast = function(type, value)
    if (tostring(type):find('Registry')) then
        return function(...)
            return 0
        end
    end
    return o_cast(type, value)
end

panorama.loadstring = function(...)
    local arguments = table.concat({...})

    if arguments:find('AsyncWebRequest') then
        return function()
            return string.format('|%s|', 0)
        end
    end
end

local renderer_text = renderer.text
renderer.text = function(x, y, r, g, b, a, flags, max_width, ...)
    local arguments = table.concat({...})

    if arguments:find('shoppy') then
        return renderer_text(x, y, r, g, b, a, flags, max_width, 'glock#0690 was here (discord.gg/luas)')
    end

    return renderer_text(x, y, r, g, b, a, flags, max_width, ...)
end

